import React from 'react'

export default class Navbar extends React.Component {

  render() {
    return (
        <div>
        <center><h1>100 Components of Code</h1></center>
        <nav className="Navbar">
              <a href="#One">One</a>
              <a href="#Two">Two</a>
              <a href="#Three">Three</a>
              <a href="#Four">Four</a>
              <a href="#Five">Five</a>
              <a href="#Six">Six</a>
              <a href="#Seven">Seven</a>
              <a href="#Eight">Eight</a>
        </nav>
      </div>
    )
  }
}
